const ChoiceList = (props) => {
    const choices=props.choices;
    const questionNum=1;
    console.log(choices.key)
    return ( 
        <div className="choice-list" key={choices.key}>
            <h2>{choices.title}</h2>
            <button>{choices.choice1}</button>
            <button>{choices.choice2}</button>
        </div>
     );
}

export default ChoiceList;
